import React from 'react'
import Card from './Card';
import './Card.css'
import '.Sdata.jsx'
import Sdata from './Sdata';

const ncard = (val) => {
    return(
        <Card
                imgsrc={val.imgsrc}
                title={val.title}
                sname={val.sname}
                link={val.link} 
            />
    );
}

const Cards = () => {
    return(
        <>
            <h1 className='heading_style'>LIST OF TOP 5 NETFLIX SERIES IN 2020</h1>
            {Sdata.map(ncard)}
        </>
    );
}

export default Cards
